def encode_base64(file):
    with open(file, 'rb') as fin:  # 第一个参数为图片全路径或相对路径
        image_data = fin.read()
        base64_data_bytes = base64.b64encode(image_data)
        base64_data_str = base64_data_bytes.decode()
        print(base64_data_str)
        return base64_data_str


